    "content": "Welcome to the Shipos Kit documentation. Here you will find all the information you need to build and deploy your SaaS application.\n\n## What is Shipos Kit?\n\nShipos Kit is a modern SaaS starter kit built with Next.js 15, TypeScript, and the latest web technologies. It provides everything you need to launch your SaaS product quickly.\n\n## Key Features\n\n- **Authentication**: Email/password and OAuth authentication with better-auth\n- **Payments**: Stripe integration with subscription management\n- **Database**: PostgreSQL with Prisma ORM and type-safe queries\n- **API Layer**: Type-safe APIs with ORPC\n- **UI Components**: Beautiful, accessible components with Radix UI\n- **Internationalization**: Multi-language support with next-intl\n- **AI Integration**: OpenAI integration for AI-powered features\n- **Admin Panel**: User management and role-based access control\n\n## Getting Started\n\nTo get started with Shipos Kit, head over to the [Getting Started guide](/docs/getting-started/overview) to learn how to set up your development environment and create your first project.\n\n## Need Help?\n\nIf you have any questions or need assistance, feel free to:\n\n- Check out our [Getting Started](/docs/getting-started/overview) guide\n- Review the documentation sections\n- Open an issue on GitHub",
